	var hideBear = {};
	var pos = {};
	function hideBearAnimation(id, position){
		pos[id] = Number(position);
		bears[id] = document.querySelector("#bear"+id);
		lights[id] = document.querySelector("#hole"+id);
		bears[id].style.top = pos[id]+"%";
		pos[id]+=5.5;
		hideBear[id] = requestAnimationFrame(function() {
			hideBearAnimation(id, pos[id]);
		});
		
		if (pos[id] > 100) {
			cancelAnimationFrame(hideBear[id]);
			lights[id].style.display = "none";
			bears[id].classList.remove("bc");
			clearTimeout(timer[id]);
		}
	}
	
	var showBear = {};
	var timer = {};
	function showBearAnimation(id) {
		var el = document.querySelector("#bear"+id);
		var pos = el.style.top.split("%")[0];
		lights[id] = document.querySelector("#hole"+id);
		lights[id].style.display = "block";
		show(id, pos);	
	}
	function show(id,position) {
		pos[id] = Number(position);
		bears[id] = document.querySelector("#bear"+id);
		bears[id].style.top = pos[id]+"%";
		pos[id]-=5.5;
		showBear[id] = requestAnimationFrame(function() {
			show(id, pos[id]);
		});
		if (pos[id] <= 0) {
			cancelAnimationFrame(showBear[id]);
			timer[id] = setTimeout(function() {
				hideOneBear(id);
			}, 400);
		}
	}
	
